stabilizers = [s.strip() for s in stabilizers_raw.split(',')]
print(f"Number of stabilizers: {len(stabilizers)}")
print(f"Qubit count: {len(stabilizers[0])}")

# Convert to stim PauliString format
def to_stim_pauli(s):
    pauli_str = stim.PauliString(len(s))
    for i, c in enumerate(s):
        if c == 'X':
            pauli_str[i] = 1  # X
        elif c == 'Y':
            pauli_str[i] = 2  # Y
        elif c == 'Z':
            pauli_str[i] = 3  # Z
    return pauli_str

pauli_stabs = [to_stim_pauli(s) for s in stabilizers]

# Use Stim's tableau to generate the circuit
try:
    tableau = stim.Tableau.from_stabilizers(pauli_stabs, allow_underconstrained=True, allow_redundant=True)
    circuit = tableau.to_circuit(method="elimination")
    print(f"Circuit generated with {len(circuit)} instructions")
    print("\nCircuit:")
    print(circuit)
except Exception as e:
    print(f"Error: {e}")
